import React, { Component } from "react";
import {Card,CardTitle,CardText,CardActions,Button,CardMenu,IconButton} from "react-mdl";


class ProjectCard extends Component {
  constructor(props){
    super(props);
  }
  render() {
    var { id, cardTitle, cardText, github, demo } = this.props.project;
    return (
      <div className="projects-grid">
        {/* Project */}
        <Card shadow={5} style = {{ minWidth: "450", margin: "auto" }}>
          <CardTitle style={{color: "#fff", height: "176px", background:"url(http://www.picks.org/wp-content/uploads/2014/10/img_0439.jpg) center / cover"}}>
          {cardTitle}
          </CardTitle>
          <CardText>{cardText} </CardText>
          <CardActions border>
            <Button colored> <a href={github}>GitHub</a> </Button>
            <Button colored> <a href={demo}>Live Demo</a> </Button>
            <Button colored  onClick={() => this.props.removePerson(id)}>More Info</Button>
          </CardActions>
          <CardMenu style={{ color: "#fff" }} />
        </Card>
      </div>
    );
  }
}

export default ProjectCard;
